import Contact from "./pages/Contact";
import About from "./pages/About";
import Home from "./pages/Home";
import Products from "./pages/Products";
import Menu from "./pages/Menu";
function App() {
  return (
    <div>
      <Menu></Menu>
      <div>


        <Switch>
          <Route exact path="/">
            <Home />
          </Route>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/Contact">
            <Contact />
          </Route>
          <Route path="/Products">
            <Products />
          </Route>
        </Switch>
      </div>
    </div>
  );
}

export default App;
